import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";


// 헤더 컨테이너 스타일
const HeaderContainer = styled.div`
  width: 100%;
  height: 100%;
  paddingLeft: 340;
  paddingRight: 340;
  paddingTop: 20;
  paddingBottom: 20;
  background: #078814;
  justifyContent: center;
  alignItems: center;
  display: inline-flex;
`;

const LogoContainer = styled.div`
  width: 154;
  alignSelf: stretch;
  paddingBottom: 3;
  justifyContent: center;
  alignItems: center;
  display: inline-flex;
`;

const LinkContainer = styled.div`
  flex: 1 1 0;
  alignSelf: stretch;
  justifyContent: center;
  alignItems: center;
  gap: 708.70;
  display: inline-flex;
`;

const LinkItem = styled(Link)`
display: flex;
width: 49.099px;
height: 21px;
flex-direction: column;
justify-content: center;
flex-shrink: 0;
color: #FFF;
font-family: Pretendard;
font-size: 18px;
font-style: normal;
font-weight: 500;
line-height: 25.2px; /* 140% */
letter-spacing: -0.18px;
  transition: color 0.3s;

  &: hover {
    color: #5365FF;
  }
`;

const Header = () => {

  return (
    <HeaderContainer>
      <LinkContainer>
        <LinkItem to="/about">About</LinkItem>
        <LinkItem to="/recruit">모집안내</LinkItem>
        <LinkItem to="/project">프로젝트</LinkItem>
      </LinkContainer>
    </HeaderContainer>
  );
};

export default Header;
